import React from "react";

class StorePrices extends React.Component {
  render() {
    const stores = Object.keys(this.props);
    console.log(stores);
    return (
      <div className="store">
        <h2 className={`h2 ${this.props.prices}`}>{this.props.storeName}</h2>
        <table>
          <caption className="offscreen">{this.props.storeName} Prices</caption>
          <thead>
            <tr>
              <th scope="col">Price per lb</th>
              <th scope="col">Unit Price</th>
              <th scope="col">Quantity</th>
            </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>{this.props.perPound}</td>
                    </tr>
                    <tr>
                        <td>{this.props.perPound}</td>
                    </tr>
                    <tr>
                        <td>{this.props.perPound}</td>
                    </tr>                    
                </tbody>
        </table>
      </div>
    );
  }
}

export default StorePrices;
